// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

import "./interfaces/IERC20.sol";
import "./interfaces/SushiSwap.sol";
import "./interfaces/Aave.sol";

contract AaveLoan {
    address private constant Aave = 0xC6845a5C768BF8D7681249f8927877Efda425baf;

    function depositAsset(address _assetAddress, uint256 _amount) public {
        // Should really be  aone time thing
        IERC20(_assetAddress).approve(Aave, _amount);

        ILendingPool(Aave).deposit(_assetAddress, _amount, address(this), 0);
    }

    function getLoan(address _assetAddress, uint256 _amount) public {
        /*
      TODO get actual interface
      borrow(address asset, uint256 amount, uint256 interestRateMode, uint16 referralCode, address onBehalfOf)
      TODO fix amount
    */
        // Borrow at a stable interst rate
        ILendingPool(Aave).borrow(_assetAddress, _amount, 1, 0, address(this));
    }
}
